Deontay disappointed me on Saturday, 22nd. I believe that was not him in that ring. He must get back there and slay Fury-thats the Deontay I know.
He must adjust his game plan, he must box, he must leave put in more power to his jab. In my view, Deontay Wilder is now a sleeping giant.
@Msingisol...Deontay Wilder fan all the way from Nairobi-Kenya.
